import React from "react";
import { useDrag } from "react-dnd";
import Avatar from "@mui/material/Avatar";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import { red } from "@mui/material/colors";
import Stack from "@mui/material/Stack";

function Employee({ employee: employee }) {
  const [{ isDragging }, drag] = useDrag(() => ({
    type: "employee",
    item: { employee: employee },
    collect: (monitor) => ({
      isDragging: !!monitor.isDragging(),
    }),
  }));

  return (
    <Card className="employee" ref={drag} style={{ flex: 1 }} key={employee.id}>
      <CardHeader
        avatar={<Avatar sx={{ bgcolor: red[500] }}>{employee.Name[0]}</Avatar>}
        title={employee.Name}
        subheader={employee.JobTitle}
      />
      {/* <CardMedia
        component="img"
        image={employee["Avatar"]["url"]}
        alt="employee image"
      /> */}
      <Avatar alt="Remy Sharp" src={employee["Avatar"]["url"]} />
      <CardContent>
        <Typography variant="body2" color="text.secondary">
          {employee.Email}
        </Typography>
        <Typography variant="body2" color="text.secondary">
          {employee.Email}
        </Typography>
      </CardContent>
    </Card>
  );
}

export default Employee;
